    false,nt"url": null,nt"notes": "This report is about a survey that was
    done to assess the amphibian and reptile diversity of the Lahontan Valley in Nevada.
    The work contained in this summary can be considered baseline data for future monitoring
    of amphibian and reptile diversity in the Lahontan Valley. All specimens were identified
    to species using Stebbins 1985. Visual encounter surveys consist of walking a specific
    area and numerating all the species observed. A total of eleven sites were surveyed
    at least twice.  The most abundant lizard species in the surveyed area are the great
    basin whiptail, long-nosed leopard lizard and the side-blotched lizard. The great
    basin gopher snake and the wandering garter snake were the most abundant snake species
    in the survey area. The most abundant amphibian species found in the Lahontan Valley
    was the introduced bullfrog.",nt"license_title": "License Not Specified",nt"extras":
